taskSetItem.script2:
var token = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();



var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("PJ", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");

//获取记录数量
sql = "select count(*) as c from userTree left outer join log on dbo.userTree.userId = dbo.[log].userId "+
      "LEFT OUTER JOIN dbo.userInfo ON dbo.userTree.userId = dbo.userInfo.id "+
      "where path like '%"+userId+"%' and "+
      "(logType='财充值' or logType='财开单' or logType='财提现' or logType='财订单完成' or logType='财订单取消1' or logType='财卡充值' or logType='财提现失败' or logType='财提成')";   
sqlResult = db.executeQuery("PJ", sql);   
es.logWarning(sql); 
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

//读取表   ISNULL(userType,'')+'`'+ISNULL(idNumber,'')
sql="SELECT ISNULL(cast(dbo.userTree.userId as varchar),'')+'`'+ISNULL(cast(dbo.log.id as varchar),'') as data ,dbo.userTree.parentUserId, dbo.userTree.path,"+ 
      "dbo.userTree.regDatetime, ISNULL(dbo.userInfo.mobile,'') as mobile,dbo.log.intParam2,CASE logType WHEN '财提成' THEN dbo.log.intParam2 ELSE 0 END AS ticheng,"+ 
      "dbo.[log].logType FROM dbo.userTree LEFT OUTER JOIN "+
      "dbo.[log] ON dbo.userTree.userId = dbo.[log].userId LEFT OUTER JOIN " +
      "dbo.userInfo ON dbo.userTree.userId = dbo.userInfo.id " +
      "where path like '%/"+userId+"/%' and (logType='财充值' or logType='财开单' or logType='财提现' or logType='财订单完成' or logType='财卡充值' or logType='财提现失败' or logType='财提成'or logType='财订单取消1' ) "; //or logType='财订单取消1'  
sqlResult = db.executeQuery("PJ", sql); 
es.logWarning(sql); 
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"data,photo1,mobile,path,logType,intParam2,ticheng", pageSize*(pageCurrent-1), pageSize); 
eio.appendString8(userId);  

es.logWarning(count); 

//es.logWarning(pageCurrent); 
es.logWarning("success");

